import React from "react";
import Habit from "./Habit";

const habits = ["Sleep", "Mind", "Exercise", "Nutrition"];

export default function Habits() {
  return (
    <div>
      {habits.map((habit) => {
        <Habit title={habits} />;
      })}
    </div>
  );
}
